/* Carousel */
document.addEventListener('DOMContentLoaded', function() {
    const slides = document.querySelectorAll('.carousel-image'); // Selecciona todas las imágenes del carrusel
    const totalSlides = slides.length / 2; // Número total de diapositivas (dividido por dos si están duplicadas)
    let currentIndex = 0; // Índice inicial del carrusel

    // Función para actualizar la posición del carrusel
    function updateCarousel() {
        const offset = currentIndex * -(100 / totalSlides); // Calcula el desplazamiento necesario
        document.querySelector('.carousel-container').style.transform = `translateX(${offset}%)`; // Aplica el desplazamiento

        // Actualiza los indicadores
        document.querySelectorAll('.carousel-indicator').forEach((indicator, index) => {
            indicator.classList.toggle('active', index === currentIndex);
        });
    }

    // Evento para cambiar automáticamente cada 3 segundos
    setInterval(() => {
        currentIndex = (currentIndex + 1) % totalSlides; // Incrementa el índice, vuelve al inicio si es necesario
        updateCarousel(); // Llama a la función para actualizar el carrusel
    }, 3000);

    // Añade eventos a los indicadores para control manual
    document.querySelectorAll('.carousel-indicator').forEach((indicator, index) => {
        indicator.addEventListener('click', () => {
            currentIndex = index; // Establece el índice actual al del indicador seleccionado
            updateCarousel(); // Actualiza el carrusel
        });
    });

    updateCarousel(); // Inicializa el carrusel al cargar
});


