/* IMÁGENES EN GRANDE CLIENTES*/
document.addEventListener('DOMContentLoaded', function() {
    var modal = document.getElementById("myModal");
    var modalImg = document.getElementById("img01");
    var captionText = document.getElementById("caption");
    var imgs = document.querySelectorAll(".actividad img, .galeria-clientes img"); // Asegúrate de seleccionar solo las imágenes necesarias
    var currentIndex = 0;  // Índice actual de la imagen

    // Función para abrir el modal y mostrar la imagen seleccionada
    function openModal(index) {
        modal.style.display = "block";
        modalImg.src = imgs[index].src;
        modalImg.style.marginTop = "0"; // Resetear margen superior para todas las imágenes
        captionText.innerHTML = imgs[index].alt;
        currentIndex = index;

        // Aplicar margen superior solo para Coco Bongo
        if (imgs[index].id == "imgco") {
            modalImg.style.marginTop = "5%";
            
            
        }

        if (imgs[index].id == "imgco") {
            
            modalImg.style.maxWidth = "800px";
        }

        if (imgs[index].id == "img1") {
            
            modalImg.style.maxWidth = "400px";
        }
    }

    // Añadir evento onclick a todas las imágenes
    imgs.forEach((img, index) => {
        img.onclick = function() {
            openModal(index);
        }
    });

    // Configuración de la funcionalidad de cierre del modal
    var span = document.getElementsByClassName("close")[0];
    span.onclick = function() {
        modal.style.display = "none";
    }

    // Agregar navegación con flechas
    var next = document.getElementsByClassName("next")[0];
    var prev = document.getElementsByClassName("prev")[0];

    next.onclick = function() {
        currentIndex = (currentIndex + 1) % imgs.length; // Circular hacia adelante
        openModal(currentIndex);
    }

    prev.onclick = function() {
        currentIndex = (currentIndex - 1 + imgs.length) % imgs.length; // Circular hacia atrás
        openModal(currentIndex);
    }
});
























